angular.module('mainApp', ['ngStorage', 'ngRoute', 'dndLists', 'btford.markdown'])
    .controller('mainController', function ($scope, $localStorage) {

        $scope.$storage = $localStorage.$default({
            styleColor: 'blue'
        });

        $scope.styleColor = $scope.$storage.styleColor;

        $scope.newColor = function(){
            $scope.$storage.styleColor = $scope.styleColor;
        };

        $scope.$storage = $localStorage;
        $scope.user = $scope.$storage.user;

        $scope.menuShowStatus = true;
        $scope.showMenu = function(){
            var menu = document.querySelector('.main-menu');
            var content = document.querySelector('.main-content');
            if($scope.menuShowStatus){
                angular.element(menu).css("transform", "translateX(-100%)");
                angular.element(content).css("margin-left", "0px");
            }else{
                angular.element(menu).css("transform", "translateX(0)");
                angular.element(content).css("margin-left", "300px");
            }
            $scope.menuShowStatus = !$scope.menuShowStatus;
        }
    })
    .config(function($routeProvider){
        $routeProvider.when('/user/profile',
        {
            templateUrl:'/user/profile',
            controller:'appCtrl'
        });
    })
    .controller("appCtrl", function($scope){
        console.log('controller set up');
    });



angular.module('mainApp')
    .controller('mainMenuController', function ($scope, $http, $localStorage) {

        $scope.user = {
            is_auth: false,
            rang: 'guest',
            avatar: '/img/no-avatar.png'
        };

        $scope.$storage = $localStorage.$default({
            user: $scope.user
        });
        if("social_id" in $scope.$storage.user){
            $scope.user = $scope.$storage.user;
        }

        $scope.userActions = [];
        $scope.userActions.exit = function(){
            delete $scope.$storage.user;
            $scope.user.is_auth = false;
            $scope.user.avatar = '/img/no-avatar.png';
            $scope.user.rang = 'guest';
        }

        $scope.authType = '';
        $scope.auth= function(){
            OAuth.initialize('EFhhDQfN18bds23egFDfL80HwE0');
            OAuth.popup($scope.authType)
                .done(function(result) {
                    result.me().done(function(data) {
                        var user = new Object();
                        if("firstname" in data){
                            user.first_name = data.firstname;
                            user.second_name = data.lastname;
                        }else{
                            var name = data.name.split(' ');
                            user.first_name = name[0];
                            user.second_name = name[1];
                        }
                        user.social_id = data.id;
                        user.social_url = data.url;
                        user.avatar = data.avatar;
                        $http.post('/auth', user)
                            .success(function(data){
                                $scope.user = Object.assign(data);
                                $scope.user.is_auth = true;
                                $scope.user.name = $scope.user.first_name + ' ' + $scope.user.second_name;
                                $scope.$storage.user = $scope.user;
                            });
                    })
                })
        }

        $scope.showUserMenuStatus = false;
        $scope.showUserMenu = function(){
            var menu = document.querySelector('.about-user--menu');
            if($scope.showUserMenuStatus){
                angular.element(menu).css('display', 'none');
            }else{
                angular.element(menu).css('display', 'block');
            }
            $scope.showUserMenuStatus = !$scope.showUserMenuStatus;
        }

    })


angular.module('mainApp')
    .controller('siteController', function ($scope, $localStorage) {

        $scope.menuBarsStatus = false;
        $scope.menuBars = function(){

            var menu = document.querySelector('.menu-pagination');
            if(!$scope.menuBarsStatus){
                angular.element(menu).css('display', 'block');
            }else{
                angular.element(menu).css('display', 'none');
            }
            $scope.menuBarsStatus = ! $scope.menuBarsStatus;
        }

        $scope.pushComment = function(){
            var elem = document.querySelector('.new_comment');
            var value = angular.element(elem).val();
            console.log(value);
        }

        $scope.site_page = "page.jade";
    })
    .controller("dndController", function($scope, $http) {



        // Model to JSON for demo purpose
        $scope.$watch('models', function(model) {
            $scope.modelAsJson = angular.toJson(model, true);
        }, true);

        $scope.page_id = 0;
        $scope.$watch('page_id', function(model) {
            if($scope.page_id != 0) {

                $http.post('/site/get_page', {page_id: $scope.page_id})
                    .success(function (data) {
                        console.log(data);


                        $scope.models = {
                            selected: null,
                            lists: {"A": [], "B": []}
                        };

                        var compotents = [
                            'text',
                            'image',
                            'video',
                            'comments'
                        ]

                        $scope.models.lists.B = data;
                        for (var i = 0; i < 4; ++i) {
                            $scope.models.lists.A.push({label: compotents[i]});
                        }
                    });
            }
        }, true);


        $scope.savePage = function(){
            var pageComponents = $scope.models.lists.B;

            console.log(pageComponents);
            $http.post('/site/save_page',
                {
                    pageComponents: pageComponents,
                    page_id: $scope.page_id
                })
                .success(function(data){
                    console.log(data);
                });
        }
    });

angular.module('mainApp')
    .controller('userController', function ($scope, $http, $localStorage) {
        $scope.$storage = $localStorage;
        $scope.user = $scope.$storage.user;

        $scope.user_sites = [];
        $http.post('/user/id' + $scope.user.id + '/profile', null)
            .success(function(data){
                $scope.user_sites = data;
            });

    });
angular.module('mainApp')
    .directive('colorSwitcher', function(){
       return {
           restrict: 'E',
           scope: {
               textAttr: '@',
               bindAttr: '='
           },
           replace: false,
           template:[
               '<div>',
               '<p>Hello! {{textAttr}}</p>',
               '<button ng-click="btnclick()">{{bindAttr}}</button>',
               '</div>'
           ].join(''),
           link: function(scope, elem, attr){
               scope.btnclick = function(){
                   scope.bindAttr = "NEW!";
               }
               elem.on('click', function(event){
                   scope.bindAttr = "NEW!";
               });
           }
       }
    });
